content:
타제품 대형쓰고있어서 
대형 사이즈 주문했는데 너무크네요 ;;;;;
어떻게 사용해야할지 걱정이예요

불편;;;
리뷰에 사이즈가 크다거 했는데
그냥 일반적인 사이즈인드ㅅ

생각보다 얼굴에 딱 붙지않고 떠요
제 얼굴이 작은편은 아닌데 말이죠;
불안해서 잘안쓰게되네요

리뷰믿고 샀는데
생각보다 작고 얼굴에닿고 자국남을듯
숨쉬기는 좀 편한것같기도 하고&hellip;

사이즈가 많~~~이 크네요
보통 대형 사이즈 구매하면 6학년 아들한테 살짝 큰감은 있어도 착용함에 있어서는 문제 없었는데 이건 못 하겠다네요;;;
성인인 저도 한 번 감아야하네요

배송도 빠르고 가격도 적당한데 개인 얼굴형에 따라 다를 수 있지만
타 제품에 비해 착용했을때 핏이 보통이네요&hellip;
새부리형 화이트 구매했어요
